import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#46387C',
      alignItems: 'center',
      paddingTop: 150
    },
    button: {
      backgroundColor: '#00D8FF',
      width: 156,
      height: 45,
      justifyContent: 'center',
      alignItems: 'center',
      borderRadius: 5
    },
    buttonIcon: {
      backgroundColor: '#00D8FF',
      width: 45,
      height: 45,
      alignItems: 'center',
      borderRadius: 5,
      flex: 1,
      justifyContent: 'center',
    },
    rightComponent: {
      
    },
    buttonText: { color: '#302850', fontSize: 16 },
    titleText: {
      color: '#00D8FF',
      fontSize: 30
    },
});


  
export default styles;
